import React from "react";

export const Search = ({ handleSearch, handleSearchInput }) => {
  function SearchClick(e) {
    e.preventDefault();
    e.target.value;
  }
  return (
    <div>
      <input type="text" />
      <button onClick={SearchClick}>검색</button>
    </div>
  );
};

export default Search;
